import React from 'react';
import { BrowserRouter as Router, Route, Link } from "react-router-dom";
import Home from '../home/home.js';
import ChatWrapper from '../chat/chatwrapper.js';
import PartnerSearch from '../partnersearch/partnersearch.js';
import Register from '../register/register.js';
import SignIn from '../signin/signin.js';


class Navigation extends React.Component {
  constructor(props){
    super(props)
    this.signOutNav = this.signOutNav.bind(this)
  }

  signOutNav(){
    this.setState({
      isSignedIn: false
    })
  }
render(){
  if (this.props.isSignedIn) {
    return (
      <Router>
          <div className = 'authenticate' >
              <nav className="navbar navbar-expand navbar-dark bg-dark">
                <img id="nav-logo" className="navbar-brand" src={require('../../img/alpha-nav.png')} style={{width: '30px'}} alt="alpha-nav" />
                  <div className="collapse navbar-collapse" id="navbarToggleExternalContent">
                    <ul className="navbar-nav">
                      <li className="nav-item">
                        <Link className="nav-link" to='/'>Home</Link>
                      </li>
                      <li className="nav-item">
                        <Link className="nav-link" to='/search/'>Search</Link>
                      </li>
                      <li className="nav-item">
                        <Link className="nav-link" to='/chat/'>Chat</Link>
                      </li>
                      <li className="nav-item">
                        <p className="nav-link" onClick = {() => this.props.onRouteChange('signout')}>Sign Out</p>
                      </li>
                   </ul>
                 </div>
              </nav>
              <Route path="/" exact component={Home} />
              <Route path="/search/" component={PartnerSearch} />
              <Route path="/chat/" render={(props) => <ChatWrapper {...props} username = {this.props.username} />} />
          </div>
        </Router>
    );
  } else {
    return (
      <Router>
        <div className = 'authenticate' >
            <nav className="navbar navbar-expand navbar-dark bg-dark">
            <img id="nav-logo" className="navbar-brand" src={require('../../img/alpha-nav.png')} style={{width: '30px'}} alt="alpha-nav" />
               <div className="collapse navbar-collapse" id="options">
                 <ul className="navbar-nav mr-auto">
                   <li className="nav-item">
                       <Link to='/signin/' className="nav-link" onClick = {() => this.props.onRouteChange('signin')} >
                         Sign In
                       </Link>
                  </li>
                   <li className="nav-item">
                   <Link to= '/register/' className= "nav-link" onClick = {() => this.props.onRouteChange('register')} >
                     Register
                   </Link>
                  </li>
                 </ul>
               </div>
            </nav>
            <Route path="/signin/" component={SignIn} />
            <Route path="/register/" component={Register} />
        </div>
      </Router>

    );
  }
}
}


export default Navigation;
